import React from 'react'

function Dish(props) {
    const {val} = props;
    return (
        <tr>
            <td>{val.name}</td>
            <td>{val.desc.slice(0, 10)}...</td>
            <td>{val.category}</td>
            <td>{val.subcategory}</td>
            <td>{val.price}</td>
            <td>{val.status}</td>
        </tr>
    )
}

export default Dish
